import React from 'react';
import { Link } from 'react-router-dom';

// import { Container } from './styles';

function StartRecipe() {
  return (
    <div>
      <Link>
        <button
          className="btn-start-recipe"
          type="button"
          data-testid="start-recipe-btn"
        >
          Start Recipe
        </button>
      </Link>
    </div>
  );
}

export default StartRecipe;
